import { useEffect, useState } from 'react'
import azureAIDetect from '@/libs/azureAIDetect'

export default function LiveWithAIDetect({ img }: { img: string | undefined }) {
  const [imgURL, setImgURL] = useState<string>()
  const [imgPositionClassName, setImgPositionClassName] = useState<string>('')
  const [box, setBox] = useState<Rectangle>()

  useEffect(() => {
    getCurrentImg()
  }, [img])

  const getCurrentImg = async () => {
    if (!img) return

    // const testImage =
    //   ''

    // Convert the Base64 string to a Blob
    const blob = base64ToBlob(img, 'image/png')
    // const blob = base64ToBlob(testImage, 'image/png')
    const imageURL = URL.createObjectURL(blob)
    const imgDimensions = (await getImageDimensions(blob)
      .then((dimensions: any) => {
        console.log('Image dimensions:', dimensions)
        return { w: dimensions.width, h: dimensions.height }
      })
      .catch((error) => {
        console.error('Error:', error)
      })) as Dimension

    // Connect AI
    let formData = new FormData()
    formData.append('file', blob)
    const response = await azureAIDetect(formData)
    let catDetected = response.find((obj: AzureImageDetectObject) =>
      obj.object.includes('cat')
    )
    if (catDetected) {
      console.log(catDetected.rectangle)
      console.log(imgDimensions)
      const box = {
        x: Math.round((catDetected.rectangle.x / imgDimensions?.w) * 100),
        y: Math.round((catDetected.rectangle.y / imgDimensions?.h) * 100),
        w: Math.round((catDetected.rectangle.w / imgDimensions?.w) * 100),
        h: Math.round((catDetected.rectangle.h / imgDimensions?.h) * 100),
      }
      setBox(box)
      setImgPositionClassName(
        `w-[${box.w}%] h-[${box.h}%] absolute top-[${box.y}%] left-[${box.x}%]`
      )
    }

    setImgURL(imageURL)
  }

  return (
    <div className='w-full h-full'>
      {img && (
        <img
          src={imgURL}
          alt='Live image'
          className='w-full h-full absolute top-0 left-0'
        />
      )}
      {box && (
        <div
          style={{
            height: `${box.h}%`,
            width: `${box.w}%`,
            position: 'absolute',
            top: `${box.y}%`,
            left: `${box.x}%`,
            zIndex: '50',
            borderStyle: 'solid',
            borderWidth: '4px',
            borderColor: '#dc2626',
          }}
        ></div>
      )}
    </div>
  )
}

// Function to convert Base64 string to Blob
function base64ToBlob(base64: string, contentType = '', sliceSize = 512) {
  const byteCharacters = atob(base64) // Decode Base64 string
  const byteArrays = []

  for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
    const slice = byteCharacters.slice(offset, offset + sliceSize)

    const byteNumbers = new Array(slice.length)
    for (let i = 0; i < slice.length; i++) {
      byteNumbers[i] = slice.charCodeAt(i)
    }

    const byteArray = new Uint8Array(byteNumbers)
    byteArrays.push(byteArray)
  }

  return new Blob(byteArrays, { type: contentType })
}

function getImageDimensions(blob: Blob) {
  return new Promise((resolve, reject) => {
    const img = new Image()
    img.onload = () => {
      const dimensions = { width: img.width, height: img.height }
      resolve(dimensions)
    }
    img.onerror = () => {
      reject(new Error('Failed to load image'))
    }
    img.src = URL.createObjectURL(blob)
  })
}
